import s from "./Map.module.css";

export default function Map() {
  return (
    <div className={s.map_div}>
      <iframe
        title="Google Map"
        frameBorder="0"
        scrolling="no"
        marginHeight="0"
        marginWidth="0"
        src="https://www.google.com/maps/search/Bahnhofstra%C3%9Fe+41/@50.8740913,12.9322238,13z/data=!3m1!4b1?entry=ttu"
        loading="lazy"
      >
        <a href="https://www.maps.ie/population/">Population Estimator map</a>
      </iframe>
    </div>
  );
}
